/* eslint-disable array-callback-return */
import React from "react";
import { useEffect } from "react";
import { useDispatch, useSelector } from "react-redux";
import { getTemperaments } from "../../redux/actions/actions";

const Temperaments = ({onClick}) => {

    const state = useSelector( state => state.temperaments);
    const dispatch = useDispatch();
    
    useEffect(()=>{
        dispatch(getTemperaments());
        
    }, [dispatch]);

   // console.log(state);

  return (
    <div>
      <label htmlFor="temperaments">Choose temperaments: </label>
      <select name="temperaments" >
          {
              state.map( t => <option value="t" key={t} onCLick={onClick}> {t} </option>)
          }
      </select>
    </div>
  );
};
export default Temperaments;
